  \"digital-data-sets-that-describe-aquifer-characteristics-of-the-antlers-aquifer-in-southeastern-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of digitized aquifer
  boundaries of the Antlers aquifer in southeastern Oklahoma. The Early Cretaceous-age
  Antlers Sandstone is an important source of water in an area that underlies about
  4,400-square miles of all or part of Atoka, Bryan, Carter, Choctaw, Johnston, Love,
  Marshall, McCurtain, and Pushmataha Counties. The Antlers aquifer consists of sand,
  clay, conglomerate, and limestone in the outcrop area. The upper part of the Antlers
  aquifer consists of beds of sand, poorly cemented sandstone, sandy shale, silt,
  and clay. The Antlers aquifer is unconfined where it outcrops in about an 1,800-square-mile
  area. The data set includes the outcrop area of the Antlers Sandstone in Oklahoma
  and areas where the Antlers is overlain by alluvial and terrace deposits and a few
  small thin outcrops of the Goodland Limestone. Most of the aquifer boundary lines
  were extracted from published digital geology data sets. Some of the lines were
  interpolated in areas where the Antlers aquifer is overlain by alluvial and terrace
  deposits near streams and rivers. The interpolated lines are very similar to the
  aquifer boundaries published in a ground-water modeling report for the Antlers aquifer.
  The maps from which this data set was derived were scanned or digitized from maps
  published at a scale of 1:250,000.\",\n\t\"license_title\": null,\n\t\"extras\":
